import React, {Component} from 'react';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import './App.css';
import io from "socket.io-client";
import HomePage from "./pages/HomePage"


class App extends Component {

  constructor(){
    super();
    this.state = {
      "endpoint": "localhost:5000"
    };
  }

  componentDidMount(){
    const socket = io(this.state.endpoint);
  }

  onClick(){
    const socket = io(this.state.endpoint);

    socket.emit("click", "abc");
  }


  render(){

    return(
      <Router>
        <div className="App">
          <Link to="/">Home</Link>
        </div>

        <Switch>
          <Route path="/"><HomePage onclick={()=>onClick()}/></Route>
        </Switch>
      </Router>
    )
  }
}


export default App;
